import React, { Component } from "react";
import { Cell } from "./Cell";
class GameBoard extends Component {
  state = {
    columns: this.props.cells
  };

  renderCells() {
    return this.state.columns.map(column => (
      <div>
        <Cell key={column} text={column} />
      </div>
    ));
  }

  render() {
    return (
      <div className="gameBoard">
        <div>
          <Cell text="1" />
          <Cell text="2" />
          <Cell text="3" />
          <Cell text="4" />
          <Cell text="5" />
          <Cell text="6" />
          <Cell text="7" />
          <Cell text="8" />
          <Cell text="9" />
        </div>
        <div>
          <Cell text="1" />
          <Cell text="2" />
          <Cell text="3" />
          <Cell text="4" />
          <Cell text="5" />
          <Cell text="6" />
          <Cell text="7" />
          <Cell text="8" />
          <Cell text="9" />
        </div>
      </div>
    );
  }
}

export { GameBoard };
